  (248365, '2c9fafb062ca71c00162cdd45c8e0008', 'Christof MeerwaldnKingston Road tel: +44 7757 188097nLondon, SW19 e-mail: cmeerw@cmeerw.orgnUnited Kingdom web: http://cmeerw.orgnnNationality: Austrian Languages: German, EnglishnnProfilennExperienced developer (and member of the ISO C++ Standards Committee) specialising in C++ development,nbacked by a Masters degree in Computer Science. Versed in several programming languages (C/C++, Python andnJava) on Unix and Win32 platforms with strong experience in language parsing and static code analysis.nnWork ExperiencennSenior Software Developer Programming Research Ltd. since 3/2010n Quickly became a key member of an elite C++ team by building on previous C++ compiler imple-nnmentation experience.nkey technologies used: test-driven developmentnn Key developer responsible for extending the in-house C++ parser to support C++11 features: autontype specifier, decltype, scoped and strongly typed enums, inline namespaces, explicitly defaultednand deleted functions, explicit conversion functions, rvalue references, variadic templates, noexcept,nalias templates, user-defined literals, inheriting constructors, range-based for loops, lamda expressionsn(including init captures and generic lambdas), uniform initialization syntax, variable templates, nullptrnand unicode character types. Ensuring quality of implementation by testing against the boost librarynand cross-checking test-cases with gcc, clang and Visual C++.nkey technologies used: latest C++ standard working draft together with the C++ core working groupnissues listnn Static code analysis for C++: Implementing new static analysis checks, ongoing maintenance andnbug-fixing.nn Contributed to the development of coding standards for AUTOSAR and RePhrase.nn Mentoring junior developers.nnSenior Software Engineer Emnico Technologies Ltd./Emnico Services Ltd. 1/2008  2/2010n Network management application development  concentrating on SMI parser, SNMP/MIB and na-nntive code integration for low-level network and OS access. Designed and implemented a versatilenframework to access MIB data by auto-generating database data-access functions from MIB modulendefinitions.nkey technologies used: Java + JNI, XML + XSLT, SQL, Apache Derby, SNMP, MIB/SMI, low-levelnnetwork accessnn Developed an asynchronous TCP/IP communication server.nkey technologies used: C++, Boostnn Support and continuous development of an optical network management (SONET/SDH) system in anUnix environment (C++ on HP-UX and Linux).nkey technologies used: C++, CMISE, OSInn Linux embedded software development.nkey technologies used: C/C++, SNMP, Linux, Python-based code generationnnnnSenior Software Engineer Alcatel-Lucent (formerly Lucent Technologies) 12/2005  12/2007n Worked in a global development team on telecom network management software for optical net-nnworks (SONET/SDH) in a Unix environment (mostly C++ on HP-UX and Linux) with a Oracle basedndatabase backend.nkey technologies used: CMISE, OSI, SQLnn Low-level architectural work: porting of the low-level networking code from HP-UX to Linux; devel-noped a debugging memory management library to facilitate detecting and tracking down of memorynmanagement bugs.nkey technologies used: low-level networking API on Linux (packet sockets), accessing a programsncall stack, reading ELF/SOM symbol tablennSoftware Engineer SBS Software Ges.m.b.H., Salzburgnfull time: 11/2001  1/2003; 2/2004  11/2005npart time: 10/1996  6/2000; 10/2000  10/2001; 4/2003  1/2004nsummer internships: 7/1994  8/1994; 7/1995  8/1995; 7/1996  9/1996nn Developed several Java/JNI libraries to access Win32 specific APIs: i.a. CEN XFS, shared access tonthe same RS-232 port by multiple processes.nkey technologies used: Java + JNI, C++, script-based automated code generation, multi-threading,nWin32nn Worked on a J2EE application for monitoring self-service banking terminals: SNMP integration,ndatabase maintenance scripts.nkey technologies used: Java + J2EE, WebSphere, SNMP, DB2 SQLnn Prototyped a custom firmware for the Linksys WRT54G to build a cost-efficient, custom securitynappliance (firewall and VPN).nkey technologies used: Linux, gcc cross compiler, VPNnn Developed a replacement for the standard Windows shell (explorer) for self-service terminals thatntakes care of starting and monitoring application processes and prevents unauthorized access to thenoperating system desktop.nkey technologies used: C++ using STL and Boost libraries; Win32 API for starting and monitoringnprocesses; COM Automation for inter-process communication and JNI for the Java integrationnn Linux server and network administration: set up a centralised directory service, firewall and VPNn(IPsec, OpenVPN) configuration.nkey technologies used: Linux, LDAP, Sambann Developed a highly scalable TCP/IP communication server for statement printers.nkey technologies used: C++ using STL and Boost libraries; multithreaded design using WindowsnNTs I/O completion ports for high scalabilitynnCommunity Service Lebenshilfe Salzburg, Werksttte Hallein 2/2003  1/2004n As an alternative to Austrias compulsory military service: working with people with mental or mul-nntiple handicaps.nnSummer Internship AT&T Laboratories Cambridge 7/2000  9/2000n Automated and improved the omniORB regression testing suite; developed a black-box CORBAnnserver testing tool in Python, based on annotations in the interface definition (IDL).nnLinux System Administrator HTBLA Salzburg part time: 9/1997  6/2000nn2nnnnEducationn10/1996  10/2001: University of Salzburg, Department of Computer Science:nn5-year course in Applied Computer Sciences leading to a Masters degree (Dipl.-nIng.)nspecialised in distributed systems and wrote Masters thesis about distributed sim-nulation: CORBA-based Conservative Distributed Discrete Event Simulationnn9/1991  6/1996: HTBLA Salzburg (secondary technical school for electronics/informatics):nMatura (A-levels) with distinctionnnIndependent Courseworknn Introduction to Databases - Coursera (Jennifer Widom, Stanford)n Cryptography - Coursera (Dan Boneh, Stanford)n Algorithms: Design and Analysis, Part 1 - Coursera (Tim Roughgarden, Stanford)n Heterogeneous Parallel Programming - Coursera (Wen-mei W. Hwu, UIUC)n Algorithms: Design and Analysis, Part 2 - Coursera (Tim Roughgarden, Stanford)n Microeconomics Principles - Coursera (Jos Vzquez-Cognet, UIUC)n Pattern-Oriented Software Architectures for Concurrent and Networked Software - Coursera (DouglasnnC. Schmidt, Vanderbilt)nnAdditional Skillsn ISO C++ Standards Committee Membernn Programming in C, C++ (including STL and some Boost libraries), Python and Java (incl. JNI) withnthe ability to quickly understand an already existing, complex code-base.nn Development for Linux/POSIX platforms and Win32.nn Strong understanding of multithreaded development (i.e. concurrency, race-conditions, contention,nthread-local storage)nn Contributor to StackOverflow for linux, sockets and multithreading tagged questions.nn Working on a socket abstraction library for C++ similar to Boost asio, but with better multithreadingnscalability.nn Developed and currently running JabRSS, an RSS (RDF Site Summary) headline notification servicenfor Jabber/XMPP.nn Significant contributions to LoquiIM, a multi-protocol instant messaging client written entirely innHTML5 and JavaScript. Implemented end-to-end encryption based on the Signal Protocol.nn Developed a HTML5-based map application for Firefox OS.nn Developed a lightweight SIP forwarding server (stateless SIP proxy) as well as a lightweight eximngreylisting server using a SQLite backend.nn Past contributor to the Open Watcom C++ compiler: major improvements to the C++ front-end (i.e.npartial template specialization and partial ordering of class templates, template functions, namespacensupport and general C++ standard compliance).nn Contributed Linux-specific epoll connection handling code to the Open Source jabberd2 XMPP servernto improve scalability for high number of concurrent connections.nn Open Source advocate familiar with many widely used Open Source licences (and with a good under-nstanding of the implications of using Open Source software in a commercial environment).nn Organising and leading day trips for small groups.nnA hyperlinked version of this CV is also available at http://cv.cmeerw.orgnn3', NULL, 'done', 'NONE', 0, 0, NULL, '2018-04-16 09:42:21', '2018-04-16 09:42:21', 0),
  (248367, '2c9fafb062ca71c00162cdd45c8e0008', E'Kurt Guntherothn1426 East Roy StreetnSeattle, Washington 98112n(206) 669-9474 / k  urt@guntheroth.com nnStaff Software EngineernA career technologist with 30+ years of commercial software design experience covering many nfull product life-cycles. Special expertise in C++ development, network protocols, optimization, nnew product concept formation, requirements analysis, software development methodologies. I nam a scientist, a craftsman, and a mentor.nnKnowledge KeywordsnSoftware Development Experience: Windows, UNIX/Linux, embedded, database, cross-platformnand multi-target development. Event-driven, real-time, parallel, multi-threaded, multi-processor. nLanguages: C++ (20+ years). C (10+ years), Java, Javascript, Perl, Python, shell scrips. nDatabases: Sybase & Microsoft SQL, SAS. Markup Languages: HTML5, XML, JSON. nDevelopment Methodologies: Scrum, Agile, traditional, ISO-9000, Test Driven Development, nCRC cards, UML. nNetworking: sockets, WireShark dissectors, ZeroMQ library, RTP and forward error correction, nTCP, UDP and multicasting, ICMP raw packets, SNMP, ASN1, H.323, IEEE 488.nKnowledge Domains: Win32, MFC, TAPI, COM, ODBC, boost, video processing, telecom, nsecurity, ssl programming, VoIP, functional test (2 U.S. patents), compilers, PLD programming, nIEEE-1149 & 1352.nTechnology Development Experience: industry standards committees, defect tracking systems, nsoftware metrics. Trained in innovation management methods; affinity analysis, idea ngeneration, facilitating, Pareto and Ishikawa analysis, Quality Function Deployment (QFD), nTotal Quality Management (TQM).nnEducation and TrainingnMaster of Business Administration, Seattle University, Seattle WA: Program partially ncompleted. Topics included marketing, statistics, operations analysisnMaster of Science in Computer Science, University of Washington, Seattle WA:nThesis topic was an object-oriented, distributed programming language largely anticipating 