h OEM Windows certification standards.nn? Designed, implemented, and documented a proprietary wire protocol for a networked nLED lighting product on contract to Micron Technologies of Boise; coded a Wireshark nsniffer plugin in C for the protocol, developed a lighting network controller in nC++/Win32/SDK that encapsulated the proprietary protocol over an asynchronous RS232nlink, and also included a full network and lighting device emulator. nn? Programmed complex core network and database server components in C++/Linux for a ndistributed database with a novel spatial indexing scheme; mentored teammates in C++, noptimized nave C++ code, improving data ingestion rate 60%, developed and ndocumented error handling system.nn? Complex network and server programming in C++ on Windows and Linux for a radio-nover-IP product; developed Wireshark dissector plugin in C for two proprietary network nprotocols, documented the protocols, made point-fixes to undocumented legacy code. nWorked with RTP protocol with NAK/Resend-based Forward Error Correction.nn? Wrote content for a wiki on multi-threaded development; created sample applications for nIntel\'s Atom Developers Program; developed test fixture control software in nC/VxWidgets.nnDuring down time, taught myself Java and Android programming, and developed an efficient nfixed-point math template for C++.nnStaff Software Engineer, 2008-2009 (6 months), Attachmate Corp., Seattle WAnDeveloped features for a cross-platform security product based on openSSH and openSSL in C nand C++ on Windows plus 20 UNIX and Linux variants on a variety of hardware. Analyzed nsecurity protocols for potential weakness and recommended fixes. Laid off with my whole team nwhen company suffered an unexpected 30% revenue shortfall going into the Great Recession.nKurt Guntheroth (kurt@guntheroth.com) page 2nnnnStaff Software Engineer, 1999-2008 (9 years), Aubeta Networks, Seattle WAnDeveloped server components of a distributed business management system and Computer-nTelephony-Integration (CTI) system in C++ on Windows. Took servers from prototype to nhighly-available production code. Developed a network monitor for Aubetas customer WAN. nBrought professional software development methods, defect tracking, documentation, and nrelease management to AuBetas software team. nn? Integrated knowledge from several sources to produce a stack traceback on Windows nstructured exceptions to facilitate rapid debugging of infrequently recurring bugs.nn? Improved mean time-to-failure of server suite from 2 hours to >1000 hours through ndebugging, refactoring, and high-availability coding techniques.nn? Scaled server apps over 1-2 orders of magnitude growth in transaction rate. nnStaff Software Engineer, 1992-1999 (7 years), Data I/O Corp., Redmond WAnChief architect and lead on a 30 man-year software project with 10 developers. Estimated nmanpower, schedules, development costs, and project budgets. Hired staff, did performance nreviews. Specified software development tools. Maintained team focus on objectives. Mentored nteam members in C++, OO design methods. Developed Win32 and embedded C++ code for two nprojects, and maintained C code for another. Did user needs analysis and design for four projects.nn? Represented Data I/O on IEEE 1532 (Boundary Scan Device Programming) and EIA/JEDECnJESD-71 (STAPL) industry standards committees. nn? Developed schedule using consensus work estimates de-rated for estimated availability. nOriginal schedule estimated code complete within two per cent.nn? Performed R&D for next-generation products. Developed product concepts. Made first ncontact with customers to establish user needs. Used rapid development techniques to meet nharsh calendar schedule. nn? Helped establish software development process standards for successful ISO-9001 ncertification. ISO 9000 internal auditor.   nnSenior Software Engineer, 1981-1992 (11 years) Fluke Corp., Everett WAnProgressive responsibility as software designer a