  (3355456, '2c9fafb062ca71c00162cdd45c8e0008', 'Abhik Banerjeenn 222 Senator Place, Apt #49nCincinnati, OH 45220 n513-364-6591nbanerjee.abhik@yahoo.co.innhttp://homepages.uc.edu/~banerjak/ nnn  nEDUCATIONnn University of Cincinnati                                                                                                                         nMaster of Science in  Computer Science                n      Cincinnati,OHn    2009 - presentnn  nMaintained a GPA of 4.0/4.0 throughout. nSpecializing in Data Mining, Algorithms for finding associations in gene Network using Semantic Web techniques.nResearch Interests: Data Mining, Algorithms, Graph Mining, Information Retrieval, MapReduce/Hadoop.n(Publication):- "Measuring the Degree Of Similarity Between Web Ontologies" (Abhik Banerjee, Hareendra Munimadugu, Srinivasa Vedanarayanan and Dr. Lawrence J Mazlack) Proceedings of the 14th WSEAS International Conference on Computers, Corfu, July 23-25, 2010nnn nUTKAL UNIVERSITY (Now BPUT)nBachelor of Engineering, Computer Sciencen  nOrissa, Indian2002-2006nnn  Independently taught Computer Science course, to a freshmen class on C and Data Structure.nHighest Aggregate score in the department for the class of 2006 (Branch Topper).nCompleted two Web Development projects in J2EE and Oracle (build an Online bidding System and the other for an Insurance Firm.)nn nEXPERIENCEnn  Cincinnati Childrens Hospital Medical Center BMI R &DnStudent Researchern  Cincinnati,OHn2010-Presentnn  Used various technologies like JSP, JAVA, AJAX, JPA, JavaScript, Prototypejs, Apache Tomcat, Firebug, ORACLE 11i for the maintenance and development of additional features for the following website -nhttp://gataca.cchmc.org/gataca/ and http://toppgene.cchmc.orgn Found hidden associations between gene ontologies and disease records using Ontologies, and then applying graph mining/Data Mining algorithms to find new associations. (These algorithms can be widely applied to any data which has been collected from various other social communities like Facebook, Twitter etc.)n Parsed huge XML files from NCBI database for further processing and finding the associations between various genes, diseases and Pubmed Ids using XML, XSLT, XPath, XML Databases,. nn nMcAfee India CenternSoftware QA Engineernn nBangalore, Indian2008-2009nn   Worked as a Software QA Engineer testing the various products on a release basis, their installation, customizations, unisntallation, reinstallation, product expiry etc. n Optimized the overall time of testing by configuring an ESXI Vmware server and ran automated scripts for testing the product builds.n  Automated the procedure of validating the Digital Signature files using C#.Net, for each product release which was earlier out of scope and was a source of a large number of bugs.nn nHCL Technologies LtdnSenior Test Engineer/ Software Developernn  nBangalore, Indian2006-2008nn Worked as a Software Developer / Senior Test Engineer developing/testing the application devised for Deutche Bank (DB) dealing in FOREX market, money market and derivative market nTrained fellow teammates on ORACLE, and JAVA basics and advanced topics.nOptimized the SQL and PL/SQL queries for the Development and Production Environment which reduced the delivery time by 25%.nn  n  nn  nn  n  nn  nn  n  nn  nn  nn  PROFESSIONAL SKILLSnn Languages / Technologies:              Java, C, C++, C#.Net, Matlabn Application Servers :                        IIS Application Server, Apache Tomcat, Java Development Servern Web and Databases:                         XHTML, ORACLE 11i,  MySQL, ORACLE SQL Developern Operating Systems:             Windows , MACINTOSH OS X, UNIX/LINUX , SOLARISn WEB Development:            JSP, ASP.Net, HTML, XML, XHTML, PHP, Perl, JavaScript , AJAXn Other Technology:                           Hadoop MapReduce, HDFS, Amazon AWS.n Other Softwares:           MS Office , Eclipse , Netbeans', NULL, 'notDone', 'NONE', 0, 0, NULL, '2018-09-10 10:45:49', '2018-09-10 10:45:49', 0),
  (3355457, '2c9fafb062ca71c00162cdd45c8e0008', 'Christof MeerwaldnKingston Road tel: +44 7757 188097nLondon, SW19 e-mail: cmeerw@cmeerw.orgnUnited Kingdom web: http://cmeerw.orgnnNationality: Austrian Languages: German, EnglishnnProfilennExperienced developer (and member of the ISO C++ Standards Committee) specialising in C++ development,nbacked by a Masters degree in Computer Science. Versed in several programming languages (C/C++, Python andnJava) on Unix and Win32 platforms with strong experience in language parsing and static code analysis.nnWork ExperiencennSenior Software Developer Programming Research Ltd. since 3/2010n Quickly became a key member of an elite C++ team by building on previous C++ compiler imple-nnmentation experience.nkey technologies used: test-driven developmentnn Key developer responsible for extending the in-house C++ parser to support C++11 features: autontype specifier, decltype, scoped and strongly typed enums, inline namespaces, explicitly defaultednand deleted functions, explicit conversion functions, rvalue references, variadic templates, noexcept,nalias templates, user-defined literals, inheriting constructors, range-based for loops, lamda expressionsn(including init captures and generic lambdas), uniform initialization syntax, variable templates, nullptrnand unicode character types. Ensuring quality of implementation by testing against the boost librarynand cross-checking test-cases with gcc, clang and Visual C++.nkey technologies used: latest C++ standard working draft together with the C++ core working groupnissues listnn Static code analysis for C++: Implementing new static analysis checks, ongoing maintenance andnbug-fixing.nn Contributed to the development of coding standards for AUTOSAR and RePhrase.nn Mentoring junior developers.nnSenior Software Engineer Emnico Technologies Ltd./Emnico Services Ltd. 1/2008  2/2010n Network management application development  concentrating on SMI parser, SNMP/MIB and na-nntive code integration for low-level network and OS access. Designed and implemented a versatilenframework to access MIB data by auto-generating database data-access functions from MIB modulendefinitions.nkey technologies used: Java + JNI, XML + XSLT, SQL, Apache Derby, SNMP, MIB/SMI, low-levelnnetwork accessnn Developed an asynchronous TCP/IP communication server.nkey technologies used: C++, Boostnn Support and continuous development of an optical network management (SONET/SDH) system in anUnix environment (C++ on HP-UX and Linux).nkey technologies used: C++, CMISE, OSInn Linux embedded software development.nkey technologies used: C/C++, SNMP, Linux, Python-based code generationnnnnSenior Software Engineer Alcatel-Lucent (formerly Lucent Technologies) 12/2005  12/2007n Worked in a global development team on telecom network management software for optical net-nnworks (SONET/SDH) in a Unix environment (mostly C++ on HP-UX and Linux) with a Oracle basedndatabase backend.nkey technologies used: CMISE, OSI, SQLnn Low-level architectural work: porting of the low-level networking code from HP-UX to Linux; devel-noped a debugging memory management library to facilitate detecting and tracking down of memorynmanagement bugs.nkey technologies used: low-level networking API on Linux (packet sockets), accessing a programsncall stack, reading ELF/SOM symbol tablennSoftware Engineer SBS Software Ges.m.b.H., Salzburgnfull time: 11/2001  1/2003; 2/2004  11/2005npart time: 10/1996  6/2000; 10/2000  10/2001; 4/2003  1/2004nsummer internships: 7/1994  8/1994; 7/1995  8/1995; 7/1996  9/1996nn Developed several Java/JNI libraries to access Win32 specific APIs: i.a. CEN XFS, shared access tonthe same RS-232 port by multiple processes.nkey technologies used: Java + JNI, C++, script-based automated code generation, multi-threading,nWin32nn Worked on a J2EE application for monitoring self-service banking terminals: SNMP integration,ndatabase maintenance scripts.nkey technologies used: Java + J2EE, WebSphere, SNMP, DB2 SQLnn Prototyped a custom firmware for the Linksys WRT54G to build a cost-efficient, custom securitynappliance (firewall and VPN).nkey technologies used: Linux, gcc cross compiler, VPNnn Developed a replacement for the standard Windows shell (explorer) for self-service terminals thatntakes care of starting and monitoring application processes and prevents unauthorized access to thenoperating system desktop.nkey technologies used: C++ using STL and Boost libraries; Win32 API for starting and monitoringnprocesses; COM Automation for inter-process communication and JNI for the Java integrationnn Linux server and network administration: set up a centralised directory service, firewall and VPNn(IPsec, OpenVPN) configuration.nkey technologies used: Linux, LDAP, Sambann Developed a highly scalable TCP/IP communication server for statement printers.nkey technologies used: C++ using STL and Boost libraries; multithreaded design using WindowsnNTs I/O completion ports for high scalabilitynnCommunity Service Lebenshilfe Salzburg, Werksttte Hallein 2/2003  1/2004n As an alternative to Austrias compulsory military service: working with people with mental or mul-nntiple handicaps.nnSummer Internship AT&T Laboratories Cambridge 7/2000  9/2000n Automated and improved the omniORB regression testing suite; developed a black-box CORBAnnserver testing tool in Python, based on annotations in the interface definition (IDL).nnLinux System Administrator HTBLA Salzburg part time: 9/1997  6/2000nn2nnnnEducationn10/1996  10/2001: University of Salzburg, Department of Computer Science:nn5-year course in Applied Computer Sciences leading to a Masters degree (Dipl.-nIng.)nspecialised in distributed systems and wrote Masters thesis about distributed sim-nulation: CORBA-based Conservative Distributed Discrete Event Simulationnn9/1991  6/1996: HTBLA Salzburg (secondary technical school for electronics/informatics):nMatura (A-levels) with distinctionnnIndependent Courseworknn Introduction to Databases - Coursera (Jennifer Widom, Stanford)n Cryptography - Coursera (Dan Boneh, Stanford)n Algorithms: Design and Analysis, Part 1 - Coursera (Tim Roughgarden, Stanford)n Heterogeneous Parallel Programming - Coursera (Wen-mei W. Hwu, UIUC)n Algorithms: Design and Analysis, Part 2 - Coursera (Tim Roughgarden, Stanford)n Microeconomics Principles - Coursera (Jos Vzquez-Cognet, UIUC)n Pattern-Oriented Software Architectures for Concurrent and Networked Software - Coursera (DouglasnnC. Schmidt, Vanderbilt)nnAdditional Skillsn ISO C++ Standards Committee Membernn Programming in C, C++ (including STL and some Boost libraries), Python and Java (incl. JNI) withnthe ability to quickly understand an already existing, complex code-base.nn Development for Linux/POSIX platforms and Win32.nn Strong understanding of multithreaded development (i.e. concurrency, race-conditions, contention,nthread-local storage)nn Contributor to StackOverflow for linux, sockets and multithreading tagged questions.nn Working on a socket abstraction library for C++ similar to Boost asio, but with better multithreadingnscalability.nn Developed and currently running JabRSS, an RSS (RDF Site Summary) headline notification servicenfor Jabber/XMPP.nn Significant contributions to LoquiIM, a multi-protocol instant messaging client written entirely innHTML5 and JavaScript. Implemented end-to-end encryption based on the Signal Protocol.nn Developed a HTML5-based map application for Firefox OS.nn Developed a lightweight SIP forwarding server (stateless SIP proxy) as well as a lightweight eximngreylisting server using a SQLite backend.nn Past contributor to the Open Watcom C++ compiler: major improvements to the C++ front-end (i.e.npartial template specialization and partial ordering of class templates, template functions, namespacensupport and general C++ standard compliance).nn Contributed Linux-specific epoll connection handling code to the Open Source jabberd2 XMPP servernto improve scalability for high number of concurrent connections.nn Open Source advocate familiar with many widely used Open Source licences (and with a good under-nstanding of the implications of using Open Source software in a commercial environment).nn Organising and leading day trips for small groups.nnA hyperlinked version of this CV is also available at http://cv.cmeerw.orgnn3', NULL, 'notDone', 'NONE', 0, 0, NULL, '2018-09-10 10:45:49', '2018-09-10 10:45:49', 0),
  (3355458, '2c9fafb062ca71c00162cdd45c8e0008', E'Kurt Guntherothn1426 East Roy StreetnSeattle, Washington 98112n(206) 669-9474 / k  urt@guntheroth.com nnStaff Software EngineernA career technologist with 30+ years of commercial software design experience covering many nfull product life-cycles. Special expertise in C++ development, network protocols, optimization, nnew product concept formation, requirements analysis, software development methodologies. I nam a scientist, a craftsman, and a mentor.nnKnowledge KeywordsnSoftware Development Experience: Windows, UNIX/Linux, embedded, database, cross-platformnand multi-target development. Event-driven, real-time, parallel, multi-threaded, multi-processor. nLanguages: C++ (20+ years). C (10+ years), Java, Javascript, Perl, Python, shell scrips. nDatabases: Sybase & Microsoft SQL, SAS. Markup Languages: HTML5, XML, JSON. nDevelopment Methodologies: Scrum, Agile, traditional, ISO-9000, Test Driven Development, nCRC cards, UML. nNetworking: sockets, WireShark dissectors, ZeroMQ library, RTP and forward error correction, nTCP, UDP and multicasting, ICMP raw packets, SNMP, ASN1, H.323, IEEE 488.nKnowledge Domains: Win32, MFC, TAPI, COM, ODBC, boost, video processing, telecom, nsecurity, ssl programming, VoIP, functional test (2 U.S. patents), compilers, PLD programming, nIEEE-1149 & 1352.nTechnology Development Experience: industry standards committees, defect tracking systems, nsoftware metrics. Trained in innovation management methods; affinity analysis, idea ngeneration, facilitating, Pareto and Ishikawa analysis, Quality Function Deployment (QFD), nTotal Quality Management (TQM).nnEducation and TrainingnMaster of Business Administration, Seattle University, Seattle WA: Program partially ncompleted. Topics included marketing, statistics, operations analysisnMaster of Science in Computer Science, University of Washington, Seattle WA:nThesis topic was an object-oriented, distributed programming language largely anticipating Java.nSpecial topics included languages, distributed systems, artificial intelligence, networks.nBachelor of Science in Computer Science, University of Washington, Seattle WA: nTopics included compilers, operating systems, algorithms, and statistics. Minor in Mathematics.nContinuing Education: Quality Function Deployment, Total Quality Management, Innovation nManagement, Universal Modeling Language, Software Design Patterns, CASE and Design nMethodologies, Advanced Windows, C++, Software Test Methodologies, System Engineering, nCadence Management Seminar, Experience-based Interviewing, ISO 9000 Internal Auditor ntraining, C++ Template Metaprogramming, Algorithm Design, Java, Android Development, nVideo and Audio Processing.nnKurt Guntheroth (kurt@guntheroth.com) page 1nnmailto:GuntherothK@acm.orgnnnEmployment HistorynnDeveloper, 2014-2015, iStreamPlanet, Redmond WAnDeveloped video pipeline code in C++/Win32. Implemented an MPEG-2 Transport Stream RTP nsender and RTP receiver with Forward Error Correction based on redundant data per SMTPE n2022-1. Developed GPU-accelerated video processing pipeline code using Intel Media Library.nnIndependent Consultant, 2009-2014 (5 years)nThe Great Recession was hard on senior people who were standing up when the music stopped. nI took a number of brief 1099 and W2 positions for several clients. Here are some highlights.nn? C++/Win32 development for Google\'s Chrome browser under contract to Microsoft. nAdded experimental CSS styles to Chrome, developed JavaScript/HTML5 test cases, nworked with Google\'s ninja build system designed for the very large Chromium code nbase.nn? C++/Win32 development for Pokki; a program launcher, app store, and advertising nnetwork for Windows that also provided a Javascript programming environment. nImproved Pokki\'s visual appearance under non-default screen settings. Measured nperformance and improved execution times by a factor of 4x. Worked with Windows nAssessment Toolkit to ensure compliance with OEM Windows certification standards.nn? Designed, implemented, and documented a proprietary wire protocol for a networked nLED lighting product on contract to Micron Technologies of Boise; coded a Wireshark nsniffer plugin in C for the protocol, developed a lighting network controller in nC++/Win32/SDK that encapsulated the proprietary protocol over an asynchronous RS232nlink, and also included a full network and lighting device emulator. nn? Programmed complex core network and database server components in C++/Linux for a ndistributed database with a novel spatial indexing scheme; mentored teammates in C++, noptimized nave C++ code, improving data ingestion rate 60%, developed and ndocumented error handling system.nn? Complex network and server programming in C++ on Windows and Linux for a radio-nover-IP product; developed Wireshark dissector plugin in C for two proprietary network nprotocols, documented the protocols, made point-fixes to undocumented legacy code. nWorked with RTP protocol with NAK/Resend-based Forward Error Correction.nn? Wrote content for a wiki on multi-threaded development; created sample applications for nIntel\'s Atom Developers Program; developed test fixture control software in nC/VxWidgets.nnDuring down time, taught myself Java and Android programming, and developed an efficient nfixed-point math template for C++.nnStaff Software Engineer, 2008-2009 (6 months), Attachmate Corp., Seattle WAnDeveloped features for a cross-platform security product based on openSSH and openSSL in C nand C++ on Windows plus 20 UNIX and Linux variants on a variety of hardware. Analyzed nsecurity protocols for potential weakness and recommended fixes. Laid off with my whole team nwhen company suffered an unexpected 30% revenue shortfall going into the Great Recession.nKurt Guntheroth (kurt@guntheroth.com) page 2nnnnStaff Software Engineer, 1999-2008 (9 years), Aubeta Networks, Seattle WAnDeveloped server components of a distributed business management system and Computer-nTelephony-Integration (CTI) system in C++ on Windows. Took servers from prototype to nhighly-available production code. Developed a network monitor for Aubetas customer WAN. nBrought professional software development methods, defect tracking, documentation, and nrelease management to AuBetas software team. nn? Integrated knowledge from several sources to produce a stack traceback on Windows nstructured exceptions to facilitate rapid debugging of infrequently recurring bugs.nn? Improved mean time-to-failure of server suite from 2 hours to >1000 hours through ndebugging, refactoring, and high-availability coding techniques.nn? Scaled server apps over 1-2 orders of magnitude growth in transaction rate. nnStaff Software Engineer, 1992-1999 (7 years), Data I/O Corp., Redmond WAnChief architect and lead on a 30 man-year software project with 10 developers. Estimated nmanpower, schedules, development costs, and project budgets. Hired staff, did performance nreviews. Specified software development tools. Maintained team focus on objectives. Mentored nteam members in C++, OO design methods. Developed Win32 and embedded C++ code for two nprojects, and maintained C code for another. Did user needs analysis and design for four projects.nn? Represented Data I/O on IEEE 1532 (Boundary Scan Device Programming) and EIA/JEDECnJESD-71 (STAPL) industry standards committees. nn? Developed schedule using consensus work estimates de-rated for estimated availability. nOriginal schedule estimated code complete within two per cent.nn? Performed R&D for next-generation products. Developed product concepts. Made first ncontact with customers to establish user needs. Used rapid development techniques to meet nharsh calendar schedule. nn? Helped establish software development process standards for successful ISO-9001 ncertification. ISO 9000 internal auditor.   nnSenior Software Engineer, 1981-1992 (11 years) Fluke Corp., Everett WAnProgressive responsibility as software designer and lead. Developed soft real-time code in C overnmany full product life cycles. nn? Designed a programming language for functional test, an object oriented editor, and an ninstrument control program similar to HP VEE or National Instruments LabWindows. nn? Member of a tiger team that developed a $20M (annual revenue) business opportunity. nReceived special innovation management training for this project. Flukes successful LAN ntester and indoor air quality meter products were outgrowths of this work. nn? Developed and patented innovative methods for testing semiconductor RAM and ROM ndevices. RAM test is 3x faster than competing algorithms and has better coverage.nn? Represented Fluke on SCPI instrument control standard committee. SCPI officer 2 years. n? Personally talked the U.S. Army out of a destructive change to MIL-T-28800 COTS nnprocurement standard. Built consensus among industry players to oppose this change.n? Revised and automated a build system, reducing build time from 7 days of human attention nnto one day. Revised build system again a year later to reduce build time to require less than none hour of human attention.nn? Led a team to perform causal analysis of over 600 bugs from a large development project. nnKurt Guntheroth (kurt@guntheroth.com) page 3nnnnPatents and PublicationsnOptimized C++, O\'Reilly, Fall 2015nhttp://www.guntheroth.com, personal web page, 2005-present nKurt Guntheroth\'s Old Hands Blog, http://oldhandsblog.blogspot.com, 2011-presentnFixed-Point Types for C++, in C/C++ Users Journal, 5/2005nCustom Exception Types for C++, in C/C++ Users Journal, 2/2005nAttacking the Causes of Software Defects, in Fluke Technical Review, 10(2), Autumn 1992nTester-Assisted Built In Test, in Proceedings of Autotestcon, 1989nAn Inexpensive Robot Prober, in Proceedings of ATE&I East, 1988nTL/1: A Language for Testing and Troubleshooting, in Proceedings of ATE&I West, 1988nRapid Prototyping Languages Considered Harmful, Fluke Technical Review 7(1), Spring 1986nMethod of and Apparatus for Diagnosing Faults in Read-Only Memory Systems and the Like, nU.S. Patent 4,876,684, issued 10/24/1989nMethod of and System for Fast Functional Testing of Random Access Memories, Jacobson et. al.,nU.S. Patent 4,715,034, issued 12/22/1987nnKurt Guntheroth (kurt@guntheroth.com) page 4nnhttp://oldhandsblog.blogspot.com/nhttp://www.guntheroth.com/', NULL, 'notDone', 'NONE', 0, 0, NULL, '2018-09-10 10:45:49', '2018-09-10 10:45:49', 0),
