with an ERP system.n Supporting system administration tasks, such as workstation installations.n Maintaining a number of servers, such as Linux, Novell Netware and Windowsnn2000 machines.nn09-03 - 02-04 and Intern Hone/Link ADMn02-05 - 06-05 IBM Nederland N.V.nnInternships at the Hone/Link ADM departmentnn Developing a system measuring the usage of Java EE applications in an IBMnzSeries mainframe environment, which is used to tax costs to various internalnorganisation deparments.nnEducationnn2008-2012 PhD Software EngineeringnDelft University of Technologynn Dissertation title: A Reference Architecture for Distributed Software De-nploymentnn Followed courses: Scientific Writing in English, The Art of Presenting Sci-nence, Philips Informatics Infrastructure Basic trainingnn Expected defense date: Januari 2013nn2005-2009 Master Computer SciencenDelft University of Technologynn Specialisation: Software Evolution, Model-driven Software Engineeringn Free elective courses: Computer graphics, Speech and language processing,nnMethodology and Ethicsn Thesis project at: Koninklijke Philips Electronics N.V., department of Health-nncare Systems Architecturen Obtained diploma in 2009nn2001-2005 HBO Computer SciencenRotterdam University of Applied Sciencesnn Specialisation: Software Engineeringn Free elective courses: Linux assembly, Sailing license, Visual Basic, Astron-nnomyn Thesis project at: IBM Nederland N.V. Hone/Link ADM departmentn Obtained diploma in 2005nn1996-2001 HAVOnRSG Hoeksche Waardnn Languages: Dutch, English, French 1 (speech and listening skills)n Profile: Nature & Technology (Mathematics B 1+2, Physics 1+2, Chem-nnistry)n Free elective courses: Economics 1, Computer Sciencen Obtained diploma in 2001nnnnPublications (selection)nn Sander van der Burg, Eelco Dolstra, Disnix: A toolset for distributed deployment, In Science ofnComputer Programming (SCP), Elsevier, September 2012nn Sander van der Burg, Eelco Dolstra, A Self-Adaptive Deployment Framework for Service-OrientednSystems, In 6th International Symposium on Software Engineering for Adaptive and Self-ManagingnSystems (SEAMS). Waikiki, Honolulu, Hawaii, USA, ACM, May 2011nn Sander van der Burg, Eelco Dolstra, Automated Deployment of a Heterogeneous Service-OrientednSystem, In 36th EUROMICRO Conference on Software Engineering and Advanced Applications (SEAA).nLille, France, IEEE Computer Society, September 2010nn Sander van der Burg, Eelco Dolstra, Merijn de Jonge, Eelco Visser, Software Deployment in a Dy-nnamic Cloud: From Device to Service Orientation in a Hospital Environment, In First ICSEn2009 Workshop on Software Engineering Challenges in Cloud Computing. Vancouver, British Columbia,nCanada, IEEE Computer Society, May 2009nnSoftware (selection)nn Disnix (http://nixos.org/disnix). A tool which can be used to automatically deploy service-orientednsystems in networks of machines. Disnix uses Nix for local deployment and ensures that deploymentnprocesses are reliable, efficient and reproducible. Disnix is available as free and open-source softwarenunder the LGPLv2 license.nn NixOS (http://nixos.org). Apart from developing Disnix, I contribute to other parts of the Nix project,nsuch as NixOS  a Linux distribution which can be installed automatically from declarative specificationsnin a reliably, reproducible and efficient way.nn IFF libraries project (http://www.st.ewi.tudelft.nl/sander/index.php/software/iff). A project whichnconsists of libraries and tools capable of parsing and viewing file formats using the IFF container spec-nification, such as images, animations and samples. All software packages are available as free andnopen-source software, such as the MIT and zlib licenses.nn WebDSL (http://webdsl.org). A domain-specific language which can be used to specify properties ofnvarious aspects of web applications in a declarative way. From a WebDSL a Java web application can bengenerated. I maintain the deployment infrastructure for these kind of applications. WebDSL is availablenas free and open-source software under the LGPLv2 license.nnSkillsnnComputer platformsn Systems: PC, IBM System Z, Amiga, Commodore 64n GNU/Linux: Slackware, Red Hat, SuSE, Debian, Ubuntu, Linux from Scratch, NixOSn Microsoft: MS-DOS, Windows 3.x, 95, 98, 2000, NT, ME, XP, Vista, 7n Other: AmigaOS, Novell Netwarennhttp://nixos.org/disnixnhttp://nixos.orgnhttp://www.st.ewi.tudelft.nl/~sander/index.php/software/iffnhttp://webdsl.orgnnnDevelopmentn Java (applications, servlets, applets, JSP, Java2D/3D, AWT/Swing)n C and C++ (POSIX, ANSI, GNU)n C# (ASP.NET, WCF, Mono)n BASIC (Quick Basic, Commodore 64 Basic, AMOS Basic, Visual Basic, Visual Basic.NET)n Assembly: x86 (Linux and MS-DOS), Commodore 64n Scripting: bash, Perl, PHP, Pythonn Other languages: Haskell, Prolog, Scala, LaTeXn Web development: HTML, XHTML, XML, XSL, CSS, JavaScript, RSS, SOAP, HTML DOMnnOthern Object-oriented analysis and design with UMLn Project methodologies: SDM, RUP, IAD, ITILn Databases: MySQL, PostgreSQL, IBM DB2, Sybase ASEn Servers: Apache HTTP server, Samba, ProFTPD, Apache Tomcat, JBoss, IBM WebSpherennOther informationnnDriving license BnHobbies Percussion and drumsnnn Curriculum Vitaen  Computer platformsn  Developmentn Other', NULL, 'notDone', 'NONE', 0, 0, NULL, '2018-09-10 10:45:49', '2018-09-10 10:45:49', 0),
