CREATE OR REPLACE FUNCTION date_null_insert_trigger_fnc()
  RETURNS trigger LANGUAGE 'plpgsql' AS $$
BEGIN
 	IF NEW.created_timestamp is NULL 
	THEN NEW.created_timestamp = CURRENT_TIMESTAMP;
	END IF;
	IF NEW.updated_timestamp is NULL 
	THEN NEW.updated_timestamp = CURRENT_TIMESTAMP;
	END IF;

  RETURN NEW;
END $$;

